import React from 'react'
import BG1 from '../assets/BG1.mp4'
const LandHome =()=>{
    return(
        <div >
            <video
            autoPlay
            loop
            muted
            style={
                {
                    position:"absolute",
                    width:"100%",
                    left:"50%",
                    top:"50%",

                    objectFit:"cover",
                    transform:"translate(-50%,-50%)",

                }
            }>
                <source src={BG1} type="video/mp4"/>
            </video>
        </div>
    )
}

export default LandHome
